import React, { useState } from "react";
import { Button, styled } from "reakit";
import Quote from "./Quote";

const Container = styled.div`
  margin: 8px;
  border: 1px solid lightgrey;
  border-radius: 2px;
`;

const Title = styled.h3`
  padding: 8px;
`;
const QuoteList = styled.div`
  padding: 8px;
`;
const Home = (props) => {
  return (
    <Container>
      <Title>{"Naslov"}</Title>
      <QuoteList>
        {console.log("fff", props.posts)}
        {/* {props.posts.map((data) => {
          <Quote key={data.id} quote={data}></Quote>;
        })} */}
      </QuoteList>
    </Container>
  );
};

export default connect(
  (store) => ({
    productCategories: store.productCategories,
    productCategory: find(store.productCategories, {
      key_name: "tesla-hyperlight-eyewear",
    }),
    products: regularProducts(
      categoryProducts(store),
      store.productCategories,
      store.wishlist,
      get(store, "user.user_level_key_name")
    ),
    pagination: categoryProductsPagination(store),
  }),
  {
    getCategoryProducts,
    clearCategoryProducts,
    addToCart,
  }
)(Home);
